import { Routes, Route } from "react-router-dom";
import './App.css';

const productitem = () => {
  
      React.useEffect(() => {
        fetch(`http://localhost:8080/products`)
          .then((res) => res.json())
          .then((res) => setusers(res.data));
  }, []);
}

export default App;
